import "../home/Home.css";
import { Modal, ModalBody,Button} from "reactstrap"

export default function Home() {
    const [modal,setModal]=useState(false)

    const signIn =()=>{
        return(
            <SignIn/>
        )
    }
    return ( <>
        <div id = 'landing-con' >
            <div>
            
                <img src = { require('../../assets/Group 4.png').default}/> 
                <h1 > source of<br/> intelligence </h1> 
                <p> Sign - up and receive unlimited accesss to all of your literatur - share your literature. </p> 
                <div>
                    <button  id='btn-signUp'>Sign Up</button>
                    <button onClick={signIn} id='btn-signIn'>Sign In</button>
                </div>
            </div>
            <img id="img-landing" src = {require('../../assets/g12.png').default }/> 
        </div> 
   
        </>
    )
    function SignIn(){
        return(
        <Modal show={true} >
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary">
            Close
          </Button>
          <Button variant="primary">
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
        )
        }
    }
